import React from 'react';
import styles from './introduce1.module.css';

const Introduce1 = () => (
  <div style={{ display: 'flex' }}>
    <span style={{ width: '60%' }}>
      <h3>
        프론트엔드 개발자를 꿈꾸는 황인상입니다.
      </h3>
    </span>
    <span style={{ width: '40%' }}>
      <div className={styles.me} />
    </span>
  </div>
);

export default Introduce1;
